import React from "react";
import { useLocation } from "react-router";
// import { useState } from "react";

export default function ServiceUser() {
  const location = useLocation();
  //   const [data, setData] = useState([]);

  const temp = JSON.parse(localStorage.getItem(location.state.service));

  temp.filter(function (object) {
    return object.name === new RegExp("text to search", "gi");
  });

  return <div>hiii{JSON.stringify(temp)}</div>;
}
